import LoginForm from "../forms/LoginForm.tsx";
import React, { Component } from "react";

class LoginPage extends Component {
  render() {
    return (
      <>
        <h2>LogIn</h2>
        <LoginForm />
      </>
    );
  }
}

export default LoginPage;
